textOriginal:
Acredito que algo como esse fato, tão grave, nenhuma pessoa em sã consciência mentiria sobre isso, a advogada tenta impregnar as falas da ex Ministra uma declaração de ódio, mentiras e prevaricação.
1) não temos provas dos fatos, mas ela tem, deve estar em sigilo;
2) o abuso e violência infantil é algo estarrecedor e REAL! já trabalhei nessa área de direitos humanos e muita coisa não é e nem era divulgada;
3) o pré julgamento atrapalha muita coisa e as entidades já esão procurando pelas provas.
